import React from "react";
import "bootstrap/dist/css/bootstrap.css";

const Movies = (props) => {
  const { data } = props;

  return (
    <ul>
      {console.log("movie.jsx data " + data)}
      {data.map((m) => {
        return (
          <list key={m.id}>
            {m.title}
            {/* <img src={m.poster_path} alt={m.title} /> */}
            {/* <h6>{m.title}</h6>
              <a href="#">Rating: {m.vote_average}</a>
              <a href="#">Overview: {m.overview}</a> */}
          </list>
        );
      })}
    </ul>
  );
};

export default Movies;
